Two bedroom pop cassettes later, Japanese Breakfast returns with its first full- fledged LP and vinyl release, Psychopomp. The album explores Zauner’s experimental interests and hosts a wide range of sound: jarring anime samples, minimalist ballads, rhythms and synths reminiscent of Tango in the Night-era Fleetwood Mac paired with the moody intimacy of Mount Eerie. After the foundation of the album was built, Zauner enlisted Ned Eisenberg to coproduce and embellish the record. Eisenberg helped with the mixing and production of the album. Psychopomp revisits and revamps lo-fi tracks and adds chilling new songs to fall in love with.","isMobileFriendly":"false","image":{"jumbo":{"path":"http://cdn.ticketfly.com/i/00/02/19/99/23-atjmbo.jpg","width":960,"height":640},"jumbo1":{"path":"http://cdn.ticketfly.com/i/00/02/19/99/23-atjmbo1.jpg","width":960,"height":540},"large":{"path":"http://cdn.ticketfly.com/i/00/02/19/99/23-atlg.jpg","width":300,"height":200},"large1":{"path":"http://cdn.ticketfly.com/i/00/02/19/99/23-atlg1.jpg","width":300,"height":200},"medium":{"path":"http://cdn.ticketfly.com/i/00/02/19/99/23-atmd.jpg","width":200,"height":133},"medium1":{"path":"http://cdn.ticketfly.com/i/00/02/19/99/23-atmd1.jpg","width":200,"height":133},"original":{"path":"http://cdn.ticketfly.com/i/00/02/19/99/23-og.jpg","width":2048,"height":1365},"small":{"path":"http://cdn.ticketfly.com/i/00/02/19/99/23-atsm.jpg","width":100,"height":67},"small1":{"path":"http://cdn.ticketfly.com/i/00/02/19/99/23-atsm1.jpg","width":100,"height":67},"square":{"path":"http://cdn.ticketfly.com/i/00/02/19/99/23-sq.jpg","width":100,"height":100},"squareSmall":{"path":"http://cdn.ticketfly.com/i/00/02/19/99/23-sqsm.jpg","width":60,"height":60},"xlarge":{"path":"http://cdn.ticketfly.com/i/00/02/19/99/23-atxl.jpg","width":500,"height":333},"xlarge1":{"path":"http://cdn.ticketfly.com/i/00/02/19/99/23-atxl1.jpg","width":500,"height":333},"xxlarge":{"path":"http://cdn.ticketfly.com/i/00/02/19/99/23-atxxl.jpg","width":650,"height":433},"xxlarge1":{"path":"http://cdn.ticketfly.com/i/00/02/19/99/23-atxxl1.jpg","width":650,"height":433}},"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"https://michellezauner.bandcamp.com/","urlMySpace":"","urlFacebook":"https://www.facebook.com/japanesebreakfast","urlTwitter":"http://twitter.com/jbrekkie","twitterScreenName":"jbrekkie"},{"id":1131497,"name":"Eskimeaux","startTime":null,"eventDescription":"Eskimeaux is the recording project of songwriter and producer Gabrielle Smith. The project began in 2007 as an outlet for Smith’s experimental and noisy home-recordings. In 2011, Smith formed The Epoch collective with several other Brooklyn-based songwriters and artists, and began developing her sound over the years into the realm of more structured pop songwriting. Smith released her full-length album, O.K., on Double Double Whammy in 2015. O.K. received wide critical acclaim, being called the #1 record of the year by the U.K. blog GoldFlakePaint, and was featured in NPR’s All Songs Considered’s Top 10 albums of 2015.

